export default function Btn({ primary, children, className, onClick, link }) {
  return (
    <div style={{ display: 'flex' }}>
      {link && <Link href={link}>
        <a style={{ margin: '0 auto' }}>
          <button
            className={`btn ${primary && className && 'primary ' + className || primary && 'primary' || className && ' ' + className}`}
          >
            {children}
          </button>
        </a>
      </Link>}
      {onClick &&

        <button
          className={`btn ${primary && className && 'primary ' + className || primary && 'primary' || className && ' ' + className}`}
          onClick={onClick}
        >
          {children}
        </button>
      }
    </div>
  )
}
